[@ThePixeledFox](https://forum.kerbalspaceprogram.com/index.php?/profile/153405-thepixeledfox/): Rontgen never used LiquidFuel; it's a Nuclear Thermal Jet, it uses the heat from nuclear fission instead of fuel combustion to generate thrust. Same principle as a Nuclear Thermal Rocket, only difference is the working fluid is atmospheric air instead of LH2. It's used like any other jet engine in the game, only differences are you trade the weight of fuel for the weight of the engine, and it can be used on Eve, Duna, or Jool.  

The Fission Reactor is just a nuclear reactor, when turned on it generates a large amount of ElectricCharge that can be used to run ion engines or ISRU parts or anything else that requires ElectricCharge.

@Gnoyze: Looks like the newest version of IFS changed some things; I'll take a look and see what needs to be altered config wise to fix it.
